import PropTypes from 'prop-types';

function FriendList({ items }) {
  return (
    <ul className="friend-list">
      {items.map(item => (
        <FriendListItem
          avatar={item.avatar}
          name={item.name}
          isOnline={item.isOnline}
          id={item.id}
        />
      ))}
    </ul>
  );
}
FriendList.propTypes = {
  friends: PropTypes.array,
};

export default FriendList;
